import React from "react";

import { Route, Switch } from "react-router-dom";

const AppRoute = ({ component: Component, layout: Layout, ...rest }) => {
  return (
    <Route
      {...rest}
      render={(props) => {
        return (
          <Layout>
            <Component {...props}></Component>
          </Layout>
        );
      }}
    ></Route>
  );
};

const App = () => {
  return <div>App</div>;
};

export default App;
